                    "bio": "Michael Caisse has been crafting code in C++ for nearly 25-years. \nHe is a regular speaker at C++Now! where his talks have been awarded Best Workshop and Most Useful Session.\nMichael is the owner of Ciere Consulting which provides software consulting and contracting services, C++ training, and Project Recovery for failing multidisciplinary engineering projects : ciere.com",
