                    "id": 953,
                    "firstName": "Oswald",
                    "lastName": "Campesato",
                    "email": "",
                    "phoneNumber": "",
                    "bio": "Oswald is passionate about education: a former PhD Candidate in Mathematics (ABD), with 4 Masters and 2 Bachelors degrees. Previously he worked in South America, Italy, and the French Riviera, and he traveled to 70 countries around the world. He has worked from C/C++/Java developer to CTO, and currently working at SwiftBot. He's comfortable in 4 languages and trying to learn Japanese. He's a Series Editor for Mercury Learning and working on his 17th book.\n",
