                                    "bio": "+WESLEY CHUN, MSCS, is the author of Prentice Hall's bestselling \"Core Python\" series (corepython.com), the \"Python Fundamentals\" companion video lectures, coauthor of \"Python Web Development with Django\" (withdjango.com), and has also written for Linux Journal, CNET, and InformIT. In addition to being an engineer and Developer Advocate at Google, he also runs CyberWeb (cyberwebconsulting.com), a consultancy specializing in Python training & engineering. Wesley has over 25 years of programming, teaching, and writing experience, including more than a decade of Python. While at Yahoo!, he helped create Yahoo!Mail & Yahoo! People Search using Python. Wesley has taught at Google, Cisco, VMware, Avaya, Hitachi, UC Santa Barbara, UC Santa Cruz, & Foothill College. He's found frequently on the global conference circuit and holds degrees in Computer Science, Mathematics, and Music from the University of California. He can be reached on Twitter (@wescpy) and Google+ (google.com/+WesleyChun).",
