                    "bio": "I am a software consultant with Slalom Silicon Valley. I have been programming since I was 13 years old and there's nothing I enjoy more than bringing new products - mobile, web, or Machine Learning models - from my imagination into reality. My most recent interest has been in harnessing cloud technologies to create more intelligent software systems - a topic which will be the focus of my presentation.",
