                    "phoneNumber": "",
                    "bio": "Jeremy Clark is an application developer and speaker with over 14 years of experience in all aspects of the development lifecycle. Through speaking and consulting, he helps developers take a \"step up\" in their skillset with a focus on making complex topics approachable to developers of all skill levels. He is a Microsoft MVP for Visual C# and has authored several courses for Pluralsight, including \"C# Interfaces\", a course aimed at giving developers a better understanding of abstraction. He lives in Southern California with 2 cats and a constantly changing stack of books to be read (both technical and fiction). For more information, visit www.jeremybytes.com.",
