                            "id": 2503,
                            "title": "Clean Code: Homicidal Maniacs Read Code, Too",
                            "description": "There's no such thing as a write-once application. The world is constantly changing, and our code needs to change with it. We'll think in small pieces and take a look at some principles and techniques that will keep our code manageable and understandable. Think about the developer who will come after you. Now, imagine that he's a homicidal maniac who knows where you live. Examples will be in C#, but the principles apply to pretty much every programming language.",
