                    "email": "",
                    "phoneNumber": "",
                    "bio": "As a Java developer and technical evangelist at JetBrains, I am interested in human computer interaction, speech recognition and natural language processing, particularly in low-power applications such as mobile phones and wearable devices.",
                    "webSite": "http://breandan.net",
                    "imageUrl": "/attendeeimage/20140411163545-15075.jpg",
