                    "bio": "<p>Steve Drucker is the founder and president of Fig Leaf Software, a full-service interactive agency based in Washington, DC. Throughout his 20-year career in IT, Steve has led dozens of enterprise web application development initiatives, authored instructor-led courseware for Intel, Sencha, Adobe, JackBe, and others, and remains active in the community as a user group manager and active technology blogger. He is currently developing apps and teaching courses using Sencha Touch, Sencha Ext JS, Acquia Drupal 7, jQuery, jQuery Mobile, Adobe ColdFusion, and Node.JS. Contact Steve at<a href=\"mailto:sdrucker@figleaf.com\">sdrucker@figleaf.com</a> and find out more about his company at <a href=\"http://www.figleaf.com/\">http://www.figleaf.com</a></p>",
