                    "lastName": "Eichenbaum",
                    "email": "",
                    "phoneNumber": "",
                    "bio": "I am a former physicist who realized that data mining and the understanding of systems is my real passion. That lead me from my PhD in Physics to the realm of web analytics where I have worked on problems in: search, personalization, NLP, reporting, product design/road-map, and basic R&D.\n\nWith over 10 years of industry experience, I have managed multiple projects and teams across a wide range of topics ranging from BI and marketing, to basic research, dashboards and SEO/SEM.\n\nSpecialties: Quantitative Analysis and Data Mining including: artificial intelligence, machine learning, natural language processing, algorithm development, personalization / profiling, reporting, and defining odd basises.\n",
