                    "lastName": "Evans",
                    "email": "",
                    "phoneNumber": "",
                    "bio": "Steve Evans has been doing DevOps since before the term DevOps was invented. He is a Pluralsight Author, five time Microsoft Most Valuable Professional (MVP), and technical Speaker at various industry events. In his spare time he manages a DevOps team at a Silicon Valley Biotech focused on improving the lives of cancer patients. For over 15 years Steve has focused on making technology better for businesses by bridging the gap between IT and Development teams.\n\nYou can follow his technical blog at <a href=\"http://www.LoudSteve.com\" target=_new>http://www.LoudSteve.com</a> or find him on twitter <a href=\"http://twitter.com/TheLoudSteve\" target=_new>@TheLoudSteve</a>.",
