                    "email": "",
                    "phoneNumber": "",
                    "bio": "Hello SV Code Campers,\n  I am Venkat Gajulapalli. I work for Intuit as a Quality Engineering manager.\nI am passionate about Quality Engineering. Specially around Continuous Integration, Tools and Automation.\n\nOutside work and family, I am into Tennis and Toastmasters.\nI served in leadership roles at Toastmasters international.\n\nLooking forward to be at SVCC this year.\n\n",
