                    "bio": "Claudia Galván is president of the Society of Women Engineers section in Silicon Valley. She is writing her dissertation on strategies to increase the pipeline of women in STEM. Claudia has almost 20 years experience in launching software products worldwide and she is considered a world-wide expert on this field.  Claudia has been responsible for building international teams from the ground-up and technology platforms in Fortune 500 companies reaching hundreds of millions of people around the world.",
