                    "bio": "Marc’s background is in open source. He was the original creator of the jQuery UI Datepicker and is constantly teaching about front-end web development through events, articles and conferences. Marc is the creator of Frontend Masters (frontendmasters.com) expert web development training and is currently building large SVG-based web applications.",
