                            "description": "In this session, we’ll walk through the essential building blocks of SVG (Scalable Vector Graphics). Then we’ll dive into transforms and matrices and how to manage the transform stack. We’ll also learn how to script against SVG with JavaScript libraries like Raphaël and D3 to make interactive web applications.\n\n- Introduction to SVG elements\n- Benefits of using SVG\n- The different ways to embed SVG\n- Scripting SVG\n- Using SVG links\n- SVG filters\n- Using CSS Animation with SVG\n- CSS Transforms and Transform Matrices\n- RaphaelJS – Primitives, Attributes, Events, Animation and Easing, Sets and Transforms\n- Other Cool SVG Stuff (Links and Demos)",
