                    "email": "",
                    "phoneNumber": "",
                    "bio": "Nuri is a consultant, author and trainer. He has been honing his craft for over 20 years.  He has been getting things done for companies big and small. He serves in leadership roles anywhere from dot-com startups to corporate line of business applications. He can be frequently found in the Silicon Beach community in LA’s. He authors online courses for PluralSight.com, and is a frequent speaker in SoCal user groups and events. When he is not working on a software project, he comes up with a software project to work on. \nOwner for Plus N Consulting Inc.  (Santa Monica, CA) http://www.plusnconsulting.com\n",
