                    "bio": "John built his first suite of rich web apps in 1996, long before most people had a clue that the web would become a powerful application platform. John continues to obsess on the front end and loves discovering new architectural patterns or applying time-honored ones to JavaScript and CSS. Now, when he's not writing open source code as a Principal Engineer at Pivotal or as Co-founder at cujoJS, he is sure to be working on some wicked cool science project or construction project with his kids.",
