                            "id": 1465,
                            "title": "Build a cross-platform enterprise LOB mobile app with offline sync",
                            "description": "You're an enterprise, and you want to build a mobile LOB app for your employees.  However, you have an on-premises database, you want to authenticate against your own Active Directory domain, and you need your app to work even when users can't get on the network.  Oh, and it has to be on iOS, Android, and Windows.  Sounds like a tall order, but come to this talk to learn how to make all the pieces fit together using Azure Mobile Services, C#, and Xamarin.",
