                    "bio": "Jon has been programming in C++ for over twenty years. He programs the C++ Track at Silicon Valley Code Camp and Chairs C++Now and CppCon. Jon has a decade’s experience as a consultant in Silicon Valley, but is currently an employee of A9.com where he works on the Amazon search engine. Jon is a Microsoft MVP for Visual C++.",
