                                    "id": 583,
                                    "firstName": "Mathias",
                                    "lastName": "Brandewinder",
                                    "email": "",
                                    "phoneNumber": "",
                                    "bio": "I have been writing software on .NET for 10 years, mostly C#, until I fell in love with F# and functional programming. I enjoy arguing about code and how to make it better, and get very excited when discussing testing or F#. My other professional interests are applied math and machine learning. If you want to know more about me, you can check out my blog <a href=\"http://www.clear-lines.com/blog/\">here</a> or find me on Twitter as <a href=\"http://twitter.com/brandewinder\">@brandewinder</a>.",
