                                    "lastName": "Finn",
                                    "email": "",
                                    "phoneNumber": "",
                                    "bio": "Kari is a Community Program Manager for the Microsoft Most Valuable professional (MVP) Award Program where she manages the relationship of consumer focused MVPs in the US.  She is also the program lead for the MVP Mentor Program, whose mission it is to foster the next generation of technologists to be leaders in their fields and communities.  Kari is very passionate about supporting young people to achieve their dreams of being leading technologists by matching them to MVP Mentors to guide them.  When not supporting the MVP community, Kari can be found perfecting the art of food fermentation and preservation.  She holds a Bachelors degree in Business Administration from the University of Washington and lives in Seattle, WA.  ",
