                    "phoneNumber": "",
                    "bio": "Deborah Kurata is an independent consultant and developer focusing on Windows and Web technologies. She has authored several technical books, speaks at conferences, and has published several Pluralsight courses. For her work in support of software developers, she has been recognized with the Microsoft Most Valuable Professional (MVP) award.",
