                    "bio": "Jonathan LeBlanc is an Emmy award winning software engineer, author of the O’Reilly book \"Programming Social Applications\", and the Head of Global Developer Evangelism at PayPal. Specializing in identity and security, hardware to web interconnectivity, data mining techniques, as well as open source initiatives around social engagement, Jonathan works on the development of emerging initiatives towards building a more user-centric web.",
