                    "phoneNumber": "",
                    "bio": "Esther is a Community Program Manager for the Microsoft Most Valuable Professional (MVP) Award Program where she focuses on the developer community.  Her passion for growing the technical capabilities of communities has led her to work in west Africa, SE and NE Asia, and the US.  When not building community or watching out for MVPs, she can be found chasing her two young kids.  Esther holds a MCP from the Massachusetts Institute of Technology (MIT) and a BA from Dartmouth College.",
