                    "lastName": "Massi",
                    "email": "",
                    "phoneNumber": "",
                    "bio": "I'm a Senior Program Manager on the Visual Studio team at Microsoft and a community champion for business application developers. Before Microsoft, I spent 15 years building business apps for small businesses as well as large enterprises. I am a frequent speaker at various software development events and you can find me on a variety of developer sites including MSDN.com, Channel 9, and my blog www.bethmassi.com. Follow me on twitter @BethMassi",
