                    "bio": "Ramona Maxwell | MCTS, MCPD SharePoint 2010 | MCTS, MCITP SQL Server 2008 |650-800-3995\n\n\n-- Currently on contract as the SharePoint Administrator for Gilead Sciences, Inc. providing infrastructure and operational support for GxP qualified SharePoint 2013 farms.\n\nFurther training available at Solver Companies, Inc., located in the Harbor Bay Business Park at the Oakland Airport and on site at your Bay Area company.",
