                    "phoneNumber": "",
                    "bio": "Bhakti Mehta is the author of \"Developing RESTful Services with JAX-RS 2.0, WebSockets and JSON\" and \"RESTful Java Patterns and Best Practices\". She has a Bachelors degree in Computer Engineering and a Masters degree in Computer Science from State University of New York. She is currently working at BlueJeans Network. She has contributed to various open source projects  and presented at numerous conferences. You can follow her on twitter at https://twitter.com/bhakti_mehta",
