                    "bio": "Nicolas Morales is a Solutions Engineer at IBM’s Silicon Valley Lab in San Jose, California, where he focuses is on developing and delivering technical assets for the IBM's Big Data Hadoop platform. He also serves as a Technical Evangelist and leads numerous developer outreach efforts. Nicolas joined IBM in 2000 and has held several positions, including Software Engineer, Application Developer, Program Manager, and Project Manager. He holds a M.S. in Software Engineering and a B.S. in Business and Management Information Systems from San Jose State University.",
