                    "bio": "<p>Mr. Mummert assumed his current senior administrative position as Vice President in 2012. His focus is leading the college in the effort to improve and expand training and education to meet workforce needs. He has been an administrator at Foothill College since 2001, serving as Interim Vice President of Workforce Development and Instruction; Dean of Business and Social Sciences; and Director of Foothill Facilities and Operations. Prior to his community college experience Mr. Mummert served as Associate Dean, Defense Language Institute at the Presidio of Monterey, California; Instructor, Command and General Staff College at Fort Leavenworth, Kansas; and Cultural Exchange Officer in Teresina, Brazil.</p>\n\n<p>He earned his B.A. in Foreign Service and International Relations from Pennsylvania State University and his M.A. in Latin American Studies from the University of New Mexico. He also served in various positions as an Engineer Officer in the US Army in Germany and Panama.</p>                                                                                                                                                                                                                                                                                                                                                                                                                                                                                      ",
