                    "bio": "Steve is an independent software consultant in Silicon Valley specializing in the Microsoft product stack having retired after a 40+ year carrier doing semiconductor industry, with side excursions in to medical image management. Over the years he has worked with a wide range of platforms from mainframes to PCs, many of which have gone to the great scrap yard in the sky. \nHe currently has strong interest in issues associated ",
