                    "lastName": "Phoenix",
                    "email": "",
                    "phoneNumber": "",
                    "bio": "Chief Technical Officer, Architect and Developer at ISSIO Solutions leading the change in Heath Care Management that benefits the consumer through the use of innovate Web Applications. He is currently architecting a new combined PHP / JS Framework that provides object persistance across both platforms with universal cross-platform methods and event handlers. Thus all objects co-exist on both platforms.\n\nProvides deep and clear thinking both in engineering architecture and customer experience that comes from being the technical lead of multiple successful startup companies that have driven their success by quick adoption of a solution that solves pain points in customers daily lives.\n\nPreviously CTO of 4-Sight, international award winner for their on demand global pre-press image transfer products that became the defacto standard in the media industry. he was responsible for the design and implementation of the Rapido File Transfer protocol to merge multiple on-demand digital circuits globally under programatic control to maximize bandwidth in an ad-hoc manner. As used by Disney, the Olympic Games, World Cup, etc to get media content quickly from one location to another.\n\nHe has a long background in software development starting with solving mathematical puzzles to writing software to solve them for him while at school.",
