                    "bio": "Devin Rader spends his day’s extoling the virtues of Twilio, the simple cloud telephony platform. Before that he worked at Infragistics where he focused on delivering great user experiences to developers using their controls.  As a participant in several .NET user groups and former INETA board member, Devin is an active supporter of the .NET community. He's also the co-author of multiple books including Professional Silverlight 4 and Professional ASP.NET 4. Follow Devin on twitter @devinrader",
