                    "bio": "Pragati is the Chief Technology Evangelist for PayPal and the author of the book \"Android Application Security Essentials\". She has more than 15 years of experience in technology domains like mobile operating systems, mobile security, payments, and commerce. From starting as a platform security engineer with Motorola, to leading mobile developer relations in North America, she has extensive technology, product and business development experience. Pragati has dual masters in Computer Science and has taught and trained computer science students at universities around the world. She is a recognized speaker at international technology events.",
