                            "id": 3661,
                            "title": "Rapid Application Development Using Data Services in Bluemix ",
                            "description": "Want the power of IBM's relational database and analytics engine but don't want to install, configure and manage it?  Then you need to learn about managed data services in Bluemix.  We will show how IBM Bluemix, an open-standards, cloud-based developer platform for building, deploying and managing apps can be leveraged for rapid application development on the cloud built on top of enterprise-level data services.  We will discuss and demo two such Bluemix services, SQL Database and Analytics Warehouse.  SQL Database adds an on-demand relational database to your Bluemix hosted application.  Powered by DB2, it provides a managed database service to handle demanding web and transactional workloads.  Analytics Warehouse service can be used for predictive analytics which can be applied to many areas including business-to-business (B2B) and business-to-consumer (B2C) areas, such as customer acquisition, retention, and winback. These analytics can be applied to technical tasks, such as predictive maintenance.  We will discuss how can we leverage analytics service in the cloud to provide the statistical analysis capability of R by using sample data sets that are stored in the BLU Acceleration for Cloud database.  Join us to get hands on and learn how to use SQLDB, AWH, and In-database R capability in the cloud. You will also learn to pump-in NOSQL document datasets into the warehouse for predictive analytics.",
