                    "lastName": "Reddy",
                    "email": "",
                    "phoneNumber": "",
                    "bio": "Sridhar is Director of Professional Services at MapR. He has extensive experience working with Java and JaveEE in many roles of the software development life cycle, including design, development, management, training and technology evangelism. He leads the HBase application development practice at MapR where his team helps customers in building HBase solutions from migrating data from SQL databases. He developed the HBase training course. Prior to MapR Sridhar led a team of Java developers to build the next generation of the Java platform at PayPal. Sridhar worked as a Technology Evangelist at Sun Microsystems for over 10 years, where he presented at many Technical conferences world wide and helped increase awareness and adoption of Java technology in the worldwide developer community.\nSridhar holds a BS in Mechanical Engineering from Osmania University in India, and an MS in Computer Science from the Florida Institute of Technology.",
