                    "lastName": "Siemer",
                    "email": "",
                    "phoneNumber": "",
                    "bio": "Andrew has been building software for over 20 years honing his skills to build large scale easy to manage systems.  A member of the ASP Insiders group and publisher of 3 programming books, Andy has been providing direction to the software development community his entire career.  Andy focuses on building effective teams that are capable of meeting a customer’s needs with appropriately sized applications that are easy to manage and delivered on time.  Outside of work, Andy is writing two non-software related books, building up his sustainable farm, home schooling his six kids, and helping to manage various three gun events.",
                    "webSite": "http://www.siemerforhire.com",
                    "imageUrl": "/attendeeimage/20140917150319-21436.jpg",
