                    "phoneNumber": "",
                    "bio": "Dylan Smith is a Microsoft MVP in ALM, and an ALM (Application Lifecycle Management) consultant for Imaginet where he spends his time helping teams become more successful at delivering software. In addition to over 16 years experience designing and architecting mission critical applications, Dylan helps run the .Net User Group in his hometown of Winnipeg, Canada. In the past 8 years Dylan has focused on agile development techniques and practices. He has led the shift to agile and lean development practices across multiple teams, projects and companies.",
