                    "bio": "Lak Sri has a master's degree in information technology and works as Senior Engineer and Cloud Lead in Ecosystem Development, helping business partners and nonprofit organizations adapt to cloud computing. His development experience in high-performance algorithms, enterprise integration, and mobile applications has helped him serve as a trusted advisor and solution architect for large IBM accounts. He has presented and demonstrated innovative solutions at events such as Pulse for several years. ",
