                    "phoneNumber": "",
                    "bio": "Silicon Valley native Megan Williams is a Senior UX Designer and spends her days focused on developing and improving PayPal’s Consumer digital wallet. Her designs focus on creating simplified and intuitive experiences. Prior to working on the digital wallet she was the lead UX Designer for the Standards and Patterns team. During her time on the Standards team she created numerous design patterns and facilitated cross organization design discussions.\n",
