                            "title": "Developing Automated Stock Trading System with Node.js",
                            "description": "Jae Yang is an aerospace engineer working in a Sunnyvale company that develops FAA qualified flight simulators and training devices. He started trading in 2006.\n\n“node-ibapi-addon” is an open source Node.js addon of Interactive Brokers API that maps C++ API calls to javascript calls. This addon allows automated trading systems developers to write the logic in javascript and to utilize many of the features of Node.js.\n\nIn this session, Jae will go over how to build and install node-ibapi-addon, and how to structure your ATS code to use the addon.\n\nBonus material on how the whole addon was written.",
