                    "lastName": "Zhovtulya",
                    "email": "",
                    "phoneNumber": "",
                    "bio": "Roman has co-founded WebServiceCenter Group in early 2004 and has since been responsible for strategic management and IT.\n\nHe received a Master's Degree in \"Communications and Media Engineering\" from Offenburg University (Germany) and has established and managed a number of technology initiatives there. One of them being \"InternetServiceCenter\" - an innovative company-like software development agency within the University.",
                    "webSite": "www.WebServiceCenter.net",
